import './App.css';
import { useState } from "react"
import axios from "axios";
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {

  const [nombre, setNombre] = useState("");
  const [apellido, setApellido] = useState("");
  const [username, setUsername] = useState("");
  const [clave, setClave] = useState("");

  const [userList, setUser] = useState([]);
  const agregar = () => {
    axios.post("http://localhost:3001/registrar", {
      nombre: nombre,
      apellido: apellido,
      username: username,
      clave: clave
    }).then(() => {
      alert("Usuario registrado con éxito!");
    });
  }

  const getUser = (req, res) => {
    axios.get("http://localhost:3001/usuario").then((response) => {
      setUser(response.data);
    });
}

  return (
    <div class="container">
      <div className="App">
      <div className="Lista">
      <button onClick={getUser} >Listar Usuarios</button>
      {
        userList.map((val, key) => {
          return <div key={key}>
            <p>Nombre: {val.nombre}</p>
            <p>Apellido: {val.apellido}</p>
            <p>Username: {val.username}</p>
            <p>Clave: {val.clave}</p>
          </div>
        })
      }
      </div>
      </div>
        <div className="card text-center">
        <div className="card-header">
          REGISTRO DE USUARIOS
        </div>
        <div className="card-body">
          { /* label nombre */ }
        <div className="input-group mb-3">
          <span className="input-group-text" id="basic-addon1"> Nombre: </span>
          <input onChange={(e) => {setNombre(e.target.value);}} type="text" className="form-control" placeholder="ingrese su nombre" aria-label="nombre" aria-describedby="basic-addon1"/>
        </div>

          { /* label apellido */}
        <div className="input-group mb-3">
          <span className="input-group-text" id="basic-addon1"> Apellido: </span>
          <input onChange={(e) => {setApellido(e.target.value);}} type="text" className="form-control" placeholder="ingrese su apellido" aria-label="apellido" aria-describedby="basic-addon1"/>
        </div>

        { /* label username */}
        <div className="input-group mb-3">
          <span className="input-group-text" id="basic-addon1"> Username: </span>
          <input onChange={(e) => {setUsername(e.target.value);}} type="text" className="form-control" placeholder="ingrese su nombre de usuario" aria-label="username" aria-describedby="basic-addon1"/>
        </div>

        { /* label clave */}
        <div className="input-group mb-3">
          <span className="input-group-text" id="basic-addon1"> Clave: </span>
          <input onChange={(e) => {setClave(e.target.value);}} type="text" className="form-control" placeholder="ingrese su contraseña" aria-label="username" aria-describedby="basic-addon1"/>
        </div>

        </div>
        <div class="card-footer text-muted">
        <button className='btn btn-success' onClick={agregar} >Registrar Usuario</button>
        </div>
      </div>
      <table class="table table-striped table-hover">
        <thead>
          <tr>
            <th scope="col">#</th>
            <th scope="col">Nombre</th>
            <th scope="col">Apellido</th>
            <th scope="col">Username</th>
            <th scope="col">Clave</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td colspan="2">Larry the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
          </table>
    </div>
  );
}

export default App;
